import Header from './component/header/Header';
import Main from './component/main/Main';
import Footer from './component/footer/Footer';
import Modal from './component/modal/Modal';
import './App.css';

function App() {
  return (
    <div id="App">
      <Header />
      <Main />
      <Footer />
      <Modal />
    </div>
  );
}

export default App;
